1. 项目名称:智能测试中心项目组,
项目描述:智能测试中心项目组搭建和集成了一套自己的开发工具,涉及项目管理、接口自动化、UI自动化、性能测试等方面。项目的开发管理放在禅道上,并使用jenkins进行下发部署。项目分为三大部分:1.自动化部分 2.性能部分 3.主体部分也是项目管理部分。
项目主体为java语言开发,前后端不分离,基于SSM开发框架和兴业的cap4j开发框架,Maven管理项目,MySql数据库。页面风格有些许类似于禅道,对自动化部分项目使用接口去调用,并且提供了流程接口单接口ui接口的用例管理,并针对于这些用例提供了页面调试功能。项目内包括配置文件管理、测试任务管理调用、数据类测试管理、性能测试管理、性能指标监控等模块。
项目的自动化部分使用的是Python的Flask框架来搭建的微服务项目,通过接口启动该项目,且该项目使用了常用的测试框架robotframework来做单接口自动化、pytest框架来做ui和流程接口自动化,和禅道进行绑定由禅道去取用例数据(单接口用例数据存储于禅道内,流程接口数据存储于MySql数据库和ui用例数据则放在微服务项目内,但是在禅道都有对应的用例来回填测试结果)来执行并将结果都回填到禅道的测试单内。
性能部分是主要是一些性能用例脚本的管理,调用和管理jmeter以及性能测试环境,监控环境性能指标,并实时回传展示曲线。提供新能测试环境自动部署,文件传输、性能用例管理生成、性能测试执行、报告生成等功能。集成有jmeter、grafana、nmon、influxdb、等工具。
2. 工作内容:
· 设计功能模块,并给出设计文档,然后通过评审;
· Java或Python项目的功能代码开发;
· 开发完成后编写测试用例进行测试;
· 测试完成提交代码等待上线测试;
· 上线后及时处理bug,并给出处理方案进行处理;
