1. 项目名称:CCGW信用卡交易网关项目组,
项目描述:信用卡交易网关项目,简称CCGW,是信用卡中心负责其他各项目系统交易转接和规范的项目。该项目使用的一系列产品均来自神州数码公司,企业服务总线SmartESB采用分布式部署的方法部署在liunx服务器上,为java语言开发,中间件有jetty以及SmartESB系统自带的中间件smartmom,使用了mongo、data base、oracle、ElasticSrarch等数据库。使用了运行监控平台smartMonitor,配置管理平台smartConsole。该项目是一个成熟的网关项目,现阶段主要做各接口业务接入、各系统接口统一服务治理、以及配合整个卡中心的一些调整。
2. 工作内容:
1、在测试组的测试框架内根据CCGW的规则编写全量的接口用例生成脚本,并在服务器部署执行维护;
2、根据每次新业务接入的增量交易编写增量接口用例并执行给出增量版本测试报告;
3、编写生产接口业务严重脚本以及生产脱敏接口用例;
4、进行log4j升级、国密改造、整体性能测试,双活性能等的性能测试;
5、编写性能测试方案,性能测试脚本,以及进行性能问题挖掘跟踪;
6、除了项目内的工作还参与测试组的测试框架功能开发,以及偶尔在测试组的分配下编写其他项目组的ui和接口用例脚本。开发过如tcp请求发送功能、python的测试框架集成java SDK发送请求方法等功能。
